// src/components/personalcare/OralCare.jsx
import React from 'react';
import './OralCare.css';

const products = [
  {
    name: 'Herbal Toothpaste',
    description: 'Natural ingredients for oral health. Fluoride-free.',
    price: 90,
    image: '/images/oral/toothpaste.jpg',
  },
  {
    name: 'Mouthwash',
    description: 'Fresh breath and germ protection. Alcohol-free.',
    price: 130,
    image: '/images/oral/mouthwash.jpg',
  },
  {
    name: 'Toothbrush Pack',
    description: 'Soft bristles for gentle cleaning. Pack of 3.',
    price: 110,
    image: '/images/oral/toothbrush.jpg',
  },
];

const OralCare = () => {
  return (
    <div className="oral-care-container container py-4">
      <h2 className="text-center mb-4">ðŸ¦· Oral Care Products</h2>
      <div className="row">
        {products.map((product, index) => (
          <div key={index} className="col-md-4 mb-4">
            <div className="card h-100 shadow-sm">
              <img
                src={product.image}
                alt={product.name}
                className="card-img-top"
                style={{ height: '200px', objectFit: 'cover' }}
              />
              <div className="card-body">
                <h5 className="card-title text-primary">{product.name}</h5>
                <p className="card-text text-muted">{product.description}</p>
                <p className="fw-bold">â‚¹{product.price}</p>
                <button className="btn btn-outline-primary w-100">Add to Cart</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default OralCare;
